import React, { Fragment } from 'react';
import classes from './CartModel.module.css';


const Backdrop=props=>{};
const Mo=props=>{};

function CartModel(props) {
  return (
    <Fragment>
      <div className={classes.cartbox}>{props.children}</div>
    </Fragment>
  );
}

export default CartModel;
